    useEffect(() => {
        console.log(props)
    }, []);
    return (
        <AdminLayout>
            <form>
                <input name='title'/>
                <input name='theme-color'/>
                <input name='description'/>
                <input name='keywords'/>
                <button type='submit'>save settings</button>
            </form>
        </AdminLayout>
    );
};

